// Portfolio.jsx
import React, { useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Portfolio.css';
import NavbarCasual from '../NavBar/NavbarCasual';
import NavbarProfessional from '../NavBar/NavbarProfessional'; // Import NavbarProfessional
import ToggleButton from '../Common/ToggleButton';

const Portfolio = ({ isCasualNavbar }) => {
  const navigate = useNavigate();

  useEffect(() => {
    if (isCasualNavbar) {
      console.log('Casual Navbar is active!');
    } else {
      console.log('Professional Navbar is active!');
    }
  }, [isCasualNavbar]);

  return (
    <div>
      {/* Conditionally render the appropriate Navbar */}
      {isCasualNavbar ? <NavbarCasual /> : <NavbarProfessional />}
      <ToggleButton to="/professional" label="Switch to Professional" />
      {/* Your portfolio content goes here */}
      <h1>Test Portfolio</h1>
    </div>
  );
};

export default Portfolio;
